column8:
メーカー希望小売価格はメーカーカタログに基づいて掲載しています<br>
【aircorno001】AIRCORNO エアコルノ001<br>
<br>
モダンで爽やかなホーロー風ペンダントライト。<br>
ホワイトをメインに、コードとセード内側のバイカラーがスタイリッシュにお部屋をイメージチェンジ。<br>
口金26、40Wの電球に対応。LED電球もお使いいただけます。<br>
カラーはホワイト×オレンジとホワイト×グリーンの２色展開です。<br>
<br>
【特徴】<br>
・モダンなホーロー風ペンダントランプ。<br>
・明るく爽やかなホワイト×オレンジorグリーンのバイカラーがおしゃれ。<br>
・省エネ、長寿命なLED電球対応。<br>
・定格消費電力は最大約40W。<br>
<br>
大人気の琺瑯（ホーロー）風のシンプルなペンダントタイプのシーリングライト。<br>
モダンなペンダントライトは、リビング照明にもピッタリの明るくて爽やかなホワイトのセードに、コードとセード内側のバイカラーがオシャレ。<br>
ライトをつけると内側のカラーが反射して、素敵なお部屋にイメージチェンジ♪<br>
一般的な引掛シーリング対応なのですぐにご使用いただけます。<br>
<br>
安心設計＆安心価格＆安心保障（１年保証）<br>
３つの安心を約束！<br>
<br>
※電球、本体取り付け用ドライバーは付属しておりません。<br>
※調光、調色電球や、調光式の壁スイッチはお使いいただけません。<br>
<br>
規格<br>
サイズ：約H1200×φ280mm<br>
コード長：約136cm<br>
電源：AC100～240V 50Hz/60Hz <br>
定格消費電力：最大約40W <br>
重さ：約0.9kg<br>
素材：アルミ/鉄<br>
